import React from 'react'
import Headermenu from "./Headermenu";
import Headertop from "./Headertop";
import Pagefooter from "./Pagefooter";
import Pagefooterinfo from "./Pagefooterinfo";
import { useState, useEffect } from "react";
import axios from "axios";
import { motion } from "framer-motion"

function MusteriForm() {

	//form data post işlemi//

	const myButtonClick = async () => {
		let requestBody = {
		service_val_name:name,
		service_val_password:password
		}
		const response = await axios.post ('https://www.mockachino.com/1b9b9eca-13b9-41/login',
		requestBody);
		if (response.data.result=="success") {
		setResult("Giriş Başarılı");
		} else {
		setResult("Hatalı kullanıcı adı veya şifre");
		}}


	//form data post işlemi //

	//Option sehir datası get işlemi //
	const [customer, setCustomerList] = useState([]);

	useEffect(() => {
	  const fetchData = async () => {
		try {
		  const response = await axios.get(
			"https://private-d90551-merteribol.apiary-mock.com/customerlist"
		  );
		  setCustomerList(response.data.CustomerList);
		} catch (error) {
		  console.error("Müşteri verileri alınamadı:", error);
		}
	  };

	  fetchData();
	}, []);
	console.log(customer);
//Option sehir datası get işlemi //
  return (
    <div>
		  {/* BEGIN HEADER */}
		  <div className="page-header">
			{/* BEGIN HEADER TOP */}
			<Headertop/>
			{/* END HEADER TOP */}
			{/* BEGIN HEADER MENU */}
			<div className="page-header-menu">
			  <div className="container">
				{/* BEGIN MEGA MENU */}
				{/* DOC: Apply "hor-menu-light" class after the "hor-menu" class below to have a horizontal menu with white background */}
				{/* DOC: Remove data-hover="dropdown" and data-close-others="true" attributes below to disable the dropdown opening on mouse hover */}
				<div className="hor-menu ">
				  <Headermenu/>
				</div>
				{/* END MEGA MENU */}
			  </div>
			</div>
			{/* END HEADER MENU */}
		  </div>
		  {/* END HEADER */}
		  {/* BEGIN PAGE CONTAINER */}
		  <div className="page-container">
			{/* BEGIN PAGE CONTENT */}
			<div className="page-content">
			  <div className="container">
				{/* BEGIN SAMPLE PORTLET CONFIGURATION MODAL FORM*/}
				<div className="modal fade" id="portlet-config" tabIndex={-1} role="dialog" aria-labelledby="myModalLabel" aria-hidden="true">
				  <div className="modal-dialog">
					<div className="modal-content">
					  <div className="modal-header">
						<button type="button" className="close" data-dismiss="modal" aria-hidden="true" />
						<h4 className="modal-title">Modal title</h4>
					  </div>
					  <div className="modal-body">
						Widget settings form goes here
					  </div>
					  <div className="modal-footer">
						<button type="button" className="btn blue">Save changes</button>
						<button type="button" className="btn default" data-dismiss="modal">Close</button>
					  </div>
					</div>
					{/* /.modal-content */}
				  </div>
				  {/* /.modal-dialog */}
				</div>
				{/* /.modal */}
				{/* END SAMPLE PORTLET CONFIGURATION MODAL FORM*/}
				{/* BEGIN PAGE BREADCRUMB */}
				<ul className="page-breadcrumb breadcrumb">
				  <li>
					<a href="#">Ana Sayfa</a><i className="fa fa-circle" />
				  </li>
				  <li>
					<a href="form_controls.html">Müşteri Yönetimi</a>
					<i className="fa fa-circle" />
				  </li>
				  <li className="active">
					Müşteri Kayıt Formu
				  </li>
				</ul>
				{/* END PAGE BREADCRUMB */}
				{/* BEGIN PAGE CONTENT INNER */}
				<div className="row">
				  <div className="col-md-12 ">
					{/* BEGIN SAMPLE FORM PORTLET*/}
					<div className="portlet light">
					  <div className="portlet-title">
						<div className="caption">
						  <span className="caption-subject font-green-sharp bold ">Müşteri Kayıt Formu</span>
						</div>
						<div className="tools">
						  <a href="javascript:;" className="collapse">
						  </a>
						</div>
					  </div>
					  <div className="portlet-body form">
						<form className="form-horizontal" role="form" method="post" name="form1" id="form1">
						  <div className="form-body">
							<div className="form-group">
							  <label className="col-md-3 control-label">Ad *</label>
